      content: "[head=3][color=red]Добро пожаловать в Лаваленд!\r[/color][/head] \n\r\nДля начала вам нужно будет запустить генераторы и взять необходимое оборудование. Теперь вы готовы приступить к добыче ресурсов!\r\n\r\nНапоминаем вам, что ваша главная задача — добывать ресурсы для станции.\r\n\r\n«Инфиритовые кристаллы» — это очень ценный ресурс, который обладает способностью к перемещению. Для шахтёров они служат валютой. Через терминал они могут обменять эти кристаллы на полезные предметы. Чтобы добыть этот кристалл, вам нужно просто копать, и вы найдёте его среди базальта!\r\n\r\n[head=3][color=gray]Обитатели:\r\r[/color][/head] \nЛегион - ужасное существо, покрытое пепельными черепами со светящимися красными глазами. Бросит труп после смерти в котором будет ядро. Это ядро будет весьма полезно для шахтёров. Чтобы получить его, вам нужно будет нанести удар по трупу существа, и тогда ядро выпадет. Ядро обладает целебными свойствами, однако их действие сохраняется всего пять минут.\r\n\r\nГолиаф - неуклюжее существо, похожее на собаку. У него множество усиков и сокрушительных челюстных мышц. Однако на гриле оно очень вкусное. Его мясо стоит 350 кредитов, а так же можно добыть разделав его кости. \r\n\r\nНаблюдатель - жуткое летающее существо с красными жилистыми рогами, торчащими из большого угрожающего глаза.\r\n\r\n[head=3][color=gray]Мегафауна:\r[/color][/head] \nКолосс - падший ангел бродит по Лаваланду, осуждая тех, кого считает нечистыми. Своими раздирающими когтями, трубочками и божественными стрелами он несет смерть и кару любому, кто подойдет слишком близко. (Сложность: средняя) \r\n\r\nЭш Дрейк - неуклюжее крылатое чудовище и почитаемый страж Некрополя. Этот огромный селезень бродит по бесплодной пустоши, извергая клубы смертоносного пламени. Он находится на юге.  (Сложность: средняя) \r\n\r\nБубльгум - король всех демонов резни. Своей тяжелой поступью он сотрясает Лаваленд, оставляя за собой кровавый след. Если вы рассердите это мясистое отродье, произойдет одно из двух: погибнет либо он либо вы, и куда более вероятен именно второй вариант.  (Сложность: сложная) \r\n\r\nЛегион - страж некрополя. Он дремлет, ожидая, когда исследователь окажется настолько глуп, чтобы постучать в его дверь. Он находится на севере.  (Сложность: низкая) \r \n\r\nСложность относительно мегафауны. *"
