зойдет одно из двух: погибнет либо он либо вы, и куда более вероятен именно второй вариант.  (Сложность: сложная) \r\n\r\nЛегион - страж некрополя. Он дремлет, ожидая, когда исследователь окажется настолько глуп, чтобы постучать в его дверь. Он находится на севере.  (Сложность: низкая) \r \n\r\nСложность относительно мегафауны. *"
